//경주번호 DataSet Load 완료 시 
function dsOutSRace_OnLoadCompleted(obj,nErrorCode,strErrorMsg,nReason)
{
	cboRACE_NO.Index = 0;
	fcSearchOddSeq();
}
//수신순서 DataSet Load 완료 시 
function dsOutOddSeq_OnLoadCompleted(obj,nErrorCode,strErrorMsg,nReason)
{
	cboOddSeq.Index = 0;
	var nRowCount = obj.GetRowCount();

	if (nMaxRows == 0)
		nMaxRows = nRowCount;

	if (nMaxRows != nRowCount)
	{
		fcSearch();
		nMaxRows = nRowCount;
	}

}

function dsOutRacer_OnLoadCompleted(obj,nErrorCode,strErrorMsg,nReason)
{
	var nRow = dsOutRacer.GetRowCount();
	var sRacer;
	var sRank;
	var sRACE_REG_NO;

	if (nRow <= 0) return;
	for (var i = 0; i < nRow; i++)
	{
		sRACE_REG_NO = dsOutRacer.GetColumn(i, "RACE_REG_NO");
		sRank		 = dsOutRacer.GetColumn(i, "RANK");
		sRacer += sRACE_REG_NO + "-" + dsOutRacer.GetColumn(i, "NM_KOR");

		if (sRank != "")
			sRacer += "(" + sRank + "착)";

		if (i < nRow - 1)
			sRacer += ", ";
	}
	stRacer.Text = "출전선수 : " + sRacer;
	fcSearchDivRate();
}

function fc_SetColor004(nRow, sColId)
{
	var nColIndex = dsOutDivRate_004.GetColIndex(sColId);
	if (dsOutDivRate_004.GetColumn(nRow, "RACE_REG_NO") == nColIndex + 1)
		return "lightgrey";
	else
		return "default";
}

function fc_SetColor005(nRow, sColId)
{
	var nColIndex = dsOutDivRate_005.GetColIndex(sColId);
	if (dsOutDivRate_005.GetColumn(nRow, "RACE_REG_NO") >= nColIndex + 1)
		return "lightgrey";
	else
		return "default";
}

function fc_SetForeColor(nRow)
{
	var nMod = nRow % 3;

	switch (nMod)
	{
		case 0:
			return "green";
			break;
		case 1:
			return "blue";
			break;
		case 2:
			return "red";
			break;
	}
}

function E05070010_OnTimer(obj,nEventID)
{
	fcSearchOddSeq();
}
